import React, { Fragment } from 'react';
import Modal from '../Modal';

const StreamDelete = () => {

    const actions = (
        <>
            <button className="ui button negative">DELETE</button>
            <button className="ui button">CANCEL</button>
        </>
    )

    return(
        <div>
            StreamDelete
            <Modal 
                title="DELETE STREAM"
                content="정말 지우시겠습니까??"
                actions={actions}
            />
        </div>
    )
}

export default StreamDelete
